pragma solidity >=0.4.21 <0.6.0;

contract CarOwnership {

    uint32 public car_id = 0;   // Product ID
    uint32 public participant_id = 0;   // Participant ID
    uint32 public owner_id = 0;   // Ownership ID

    struct car {
        string makeName; // Toyota, BMW, etc.
        string modelName;
        string bodyStyle;
        address carOwner;
        uint32 mfgTimeStamp;
    }

    mapping(uint32 => car) public cars;

    struct owner {
        string idNumber; // passport ID, SSN, etc.
        string firstName;
        string lastName;
        address ownerAddress;
    }

    mapping(uint32 => owner) public owners;

    struct ownership {
        uint32 carId;
        uint32 ownerId;
        uint32 trxTimeStamp;
        address carOwner;
    }

    mapping(uint32 => ownership) public ownerships; // ownerships by ownership ID (owner_id)
    mapping(uint32 => uint32[]) public carTrack;  // ownerships by Car ID (car_id) / Movement track for a car

    event TransferOwnership(uint32 carId);

    function addOwner(string memory _idNumber, string memory _firstName, string memory _lastName, address _pAdd) public returns (uint32){
        uint32 userId = owner_id++;
        owners[userId].idNumber = _idNumber;
        owners[userId].firstName = _firstName;
        owners[userId].lastName = _lastName;

        owners[userId].ownerAddress = _pAdd;

        return userId;
    }

    function getOwner(uint32 _owner_id) public view returns (string memory,string memory, address) {
        return (owners[_owner_id].firstName,
                owners[_owner_id].lastName,
                owners[_owner_id].ownerAddress);
    }

    function addCar(uint32 _ownerId,
                        string memory _makeName,
                        string memory _modelName,
                        string memory _bodyStyle) public returns (uint32) {
            uint32 carId = car_id++;

            cars[carId].makeName = _makeName;
            cars[carId].modelName = _modelName;
            cars[carId].bodyStyle = _bodyStyle;
            cars[carId].carOwner = owners[_ownerId].ownerAddress;
            cars[carId].mfgTimeStamp = uint32(now);

            return carId;
    }

    modifier onlyOwner(uint32 _carId) {
         require(msg.sender == cars[_carId].carOwner,"");
         _;

    }

    function getCar(uint32 _carId) public view returns (string memory,string memory,string memory,address,uint32){
        return (cars[_carId].makeName,
                cars[_carId].modelName,
                cars[_carId].bodyStyle,
                cars[_carId].carOwner,
                cars[_carId].mfgTimeStamp);
    }

    function newOwner(uint32 _user1Id,uint32 _user2Id, uint32 _carId) onlyOwner(_carId) public {
        owner memory p1 = owners[_user1Id];
        owner memory p2 = owners[_user2Id];

        require(p1.ownerAddress == address(p1.ownerAddress),"Invalid address");  // simple check if owners exist
        require(p2.ownerAddress == address(p2.ownerAddress),"Invalid address");

        uint32 ownership_id = owner_id++;

        ownerships[ownership_id].carId = _carId;
        ownerships[ownership_id].carOwner = p2.ownerAddress;
        ownerships[ownership_id].ownerId = _user2Id;
        ownerships[ownership_id].trxTimeStamp = uint32(now);
        cars[_carId].carOwner = p2.ownerAddress;
        carTrack[_carId].push(ownership_id);
        emit TransferOwnership(_carId);
    }

    function getProvenance(uint32 _carId) external view returns (uint32[] memory) {

       return carTrack[_carId];
    }

    function getOwnership(uint32 _regId)  public view returns (uint32,uint32,address,uint32) {

        ownership memory r = ownerships[_regId];

        return (r.carId,r.ownerId,r.carOwner,r.trxTimeStamp);
    }

}
